import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img
          src="https://i.pinimg.com/originals/ce/b8/63/ceb8632252376a23be9f689901b9e3d3.png"
        />
      </header>
      <nav className="nav">
        <div><a>Profile</a></div>
        <div><a>Messages</a></div>
        <div><a>Feed</a></div>
        <div><a>Videos</a></div>
        <div><a>Settings</a></div>
      </nav>
      <div className="content">Main content</div>
    </div>
  );
}

export default App;
